    font-family: 'DM Sans', Arial, sans-serif;
    font-weight: 400;
  }

.content {
    h1 {
        text-align: right;
        font-weight: 300;
        font-size: 1.6em;
        color: $color-primary;
        margin-right: 10%;
        margin-top: -3.1%;
        margin-bottom: 4%;
        @include mobile-l-only {
            font-size: 0.8em;
            margin-top: -23.5%;
            margin-right: 4%;
            margin-bottom: 35%;
        }
        @include mobile-m-only {
            margin-top: -25.5%;
            margin-bottom: 37%;
        }
        @include mobile-s-only {
            margin-top: -30.5%;
            margin-bottom: 42%;
        }
    }
    &__photographer__profile {
        a {
            text-decoration: none;
        }
        h2 {
            font-weight: 300;
            font-size: 2.3em;
            color: $color-secondary;
            margin-top: 3%;
            @include mobile-l-only {
                font-size: 1.8em;
            }
        }
        h3 {
            font-weight: 300;
            font-size: 0.85em;
            margin: 1%;
            color: $color-primary;
        }
        p {
            font-size: 0.8em;
            font-weight: 500;
        }
        h4 {
            font-weight: 300;
            font-size: 0.7em;
            margin: 1%;
        }
    }
}

.content-photographer {
    h2 {
        font-size: 2.6em;
        font-weight: 300;
        color: $color-secondary;
        @include mobile-l-only {
            font-size: 1.6em;
        }
    }
    h3 {
        font-weight: 300;
        font-size: 1.2em;
        color: $color-primary;
        margin: 4% 0%;
    }
    p {
        font-size: 0.8em;
        margin: 4% 0%;
    }
    h4 {
        font-size: 0.9em;
    }
    h5 {
        font-size: 1.1em;
        font-weight: 300;
        color: $color-primary;
    }
}

.modal-contact__content {
    h1 {
        font-weight: 300;
        font-size: 2.3em;
        margin-top: 1%;
        @include mobile-m-only {
            font-size: 2.1em;
        }
        @include mobile-s-only {
            font-size: 1.8em;
            margin-top: 3%;
        }
    }
    h2 {
        font-weight: 300;
        font-size: 2.3em;
        margin-bottom: 4%;
        color: $color-black;
        @include mobile-m-only {
            font-size: 2.1em;
        }
        @include mobile-s-only {
            font-size: 1.8em;
        }
    }
