            transform: scale(0.9);
            @include mobile-l-only {
                top: 30px;
            }
            &::before, &::after {
                position: absolute;
                left: 15px;
                content: " ";
                height: 33px;
                width: 3px;
                background-color: #fff;
            }
            &::before {
                transform: rotate(45deg);
            }
            &::after {
                transform: rotate(-45deg);
            }
        }
    } 
}

